import React from 'react';
import './HomePage.css';

function HomePage() {
  return (
    <div className="container">
      <h1>Howdy!Welcome to my page</h1>
      <p>This is my page about wpaskjbdn zqnakjsnde.</p>
      <p1> I am Varshani Reddy Patlolla.</p1>
      <p2> A student at the Texas A&M University College Station</p2>
      <p3> This is my ISR course homework regarding wpaskjbdn zqnakjsnde</p3>
      <div className="button-container">
        <button className="button">Button 1</button>
        <input type="text" placeholder="Search" className="search-bar" />
        <button className="button">Button 2</button>
      </div>
    </div>
  );
}

export default HomePage;
